import React, { Component} from "react";
import Teleoperation from "./Teleoperation";
import { Row, Col, Container, Button } from "react-bootstrap";

class RobotState extends Component{
    state = {
        x: 0,
        y: 0,
        Orientation: 0,
        Linear_velocity: 0,
        angular_velocity: 0,
    };



    render(){
        return(
            <div>
                <Row className="mb-5">
                    <Col >
                        <h3 className="mt-4">position</h3>
                        <p className="mt-0"> x: {this.state.x} </p>
                        <p className="mt-0"> y: {this.state.x} </p>
                        <p className="mt-0"> Orientation: </p>
                    </Col>
                </Row>
                <Row>
                <Col >
                        <h3 className="mt-4">Velocites</h3>
                        <p className="mt-0"> Linear Velocity: </p>
                        <p className="mt-0"> Angular Velocity: </p>
                    </Col>
                </Row>
            </div>
        );
    }
}

export default RobotState;
